const type="CONTACT_CONTENT_DATA_SUCCESS"
export function contactContentDataSuccess(contact) {
    return {
        type: type,
        payload: contact
    }
}

export const contactContentData = (url) => dispatch => {
    fetch(url)
        .then(
            response => {
                if (!response.ok) {
                    throw new Error(response.statusText)
                }
                return response
            })
        .then(response => response.json())
        .then(contact => dispatch(contactContentDataSuccess(contact)))
}
